	  291678,NULL,17839,NULL,2006,
	  "0.00 FREE",36.000,NULL,"Excerpts from Get a Life: The Collected Monsieur Jean Short (ISBN: 1896597793 Hardcover 144pp  June 2006 Drawn & Quarterly); and Maybe Later (ISBN: 1896597211 Hardcover 120pp June 2006 Drawn & Quarterly).  Both artists are listed as creators. One interior story (Monsieur Jean: Women and Children First) has the artists discussing creative aspects of a particular strip and Phillipe is telling Charles he's in the process of inking a page which lends me to assume Charles Berberian is the artist and Phillipe Dupuy the inker (respectfully). However there is no indication which of these cartoonists is responsible for art and inks. Further research on these cartoonists did not provide any answers.",
