	  291799,"1",17876,NULL,1996,
	  "2.50 USD; 3.50 CAD",36.000,NULL,"Credits acknowledge special thanks to Allan Kausch & Lucy Autrey Wilson at Lucasfilm Licensing and also to Rob Rose Evelyn Harris Clem Robins Steve Sansweet and Monty Sheldon. These stories were originally commissioned in the early 1980s by Marvel U.K. for their Star Wars: The Empire Strikes Back black-and-white magazine.  Long-time fans will remember that these early Star Wars comics both in the U.S. and in Great Britain did not stick as closely to established style and continuity then as they do now.  The stories are presented here in America and in color for the first time as historical curiosities and a look at the early work of some of England's finest creative talent. [per inside front cover]",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
