	  297573,"1",18268,2,2003,
	  "39.95 USD; 65.95 CAD",176.000,NULL,"CHALLENGERS OF THE UNKNOWN ARCHIVES VOL. 1 reprints the original 1950s tales of four death defying adventurers and their impossible and unimaginable exploits. After surviving the crash of a small aircraft test pilot Ace Morgan daredevil Red Ryan heavyweight boxing champ Rocky Davis and marine scientist Professor Haley unite themselves in a mission to explore the unexplainable for the good of mankind. This beautiful hardcover edition tells the earliest adventurers of these four men of different backgrounds and personalities as they encounter powerful aliens deadly robots and creatures of unknown origins. Black-and-white reconstruction on selected interior pages by Rick Keene. Series design by Alex Jay/Studio J. Publication design by Peter Hamboussi. Special thanks to John Morrow for source material.",
	  "1563899973","1563899973",978156389997353999,NULL,2003,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  297574,"2",18268,2,2004,
	  "39.95 USD; 61.95 CAD",176.000,NULL,"A second thrilling Archive Edition featuring the adventures of the Challengers of the Unknown with art by Jack Kirby & Wally Wood! This volume collects CHALLENGERS OF THE UNKNOWN #3-8 circa 1958-1959. This volume is highlighted by a host of '50s science-fiction oddities including a mysterious \"star stone\" that bestows super-powers a space circus monsters from space a planet populated by robots and more! Plus an introduction by John Morrow editor/publisher of The Kirby Collector. Black-and-white reconstruction on selected interior pages by Rick Keene. Series design by Alex Jay/Studio J. Publication design by Peter Hamboussi. Special thanks to John Morrow for source material.",
	  "9781401201531","9781401201531",NULL,NULL,2004,NULL
