	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  297581,"1",18273,2,1996,
	  "49.95 USD; 70.95 CAD",232.000,NULL,"While working in his lab police scientist Barry Allen was struck by lightning at the exact same time that he became doused in chemicals. But instead of scarring him or taking his life this freak accident gave him a new one as the Flash the fastest man alive. This hardcover epic reprints the original 1950s tales that first introduced the Flash and his colorful assortment of villains. Relive the scarlet speedster's earliest adventures and learn the origins of one of DC's classic heroes. Series design by Alex Jay / Studio J. Publication design by Eddie Ortiz. Black and white reconstruction on some interior pages by Rick Keene. Color reconstruction by Rick Taylor and Tom McCraw.",
	  "1563891395","1563891395",76194120505200111,NULL,1996,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  297582,"2",18273,2,2000,
	  "49.99 USD; 76.00 CAD",232.000,NULL,"When police scientist Barry Allen was struck by lighting while working with chemicals in his lab he suddenly became the fastest man alive. Reprinting the amazing adventures of the Scarlet Speedster THE FLASH ARCHIVES VOL. 2 is a wonderful history of the Sultan of Speed. Featuring the first appearance and origin of Kid Flash and the Elongated Man this gorgeous edition includes some of the Flash's most classic battles against the Mirror Master the Weather Wizard the Trickster Captain Cold and Gorilla Grodd. Series design by Alex Jay / Studio J. Publication design by Louis Prandi. Black and white reconstruction on some interior pages by Rick Keene. Color reconstruction by Digital Chameleon.",
	  NULL,NULL,NULL,NULL,2000,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  297583,"3",18273,2,2002,
	  "49.99 USD; 82.95 CAD",232.000,NULL,"THE FLASH ARCHIVES VOL. 3 features the Scarlet Speedster in his earliest 1960s adventures as he patrols and protects the streets of Central City against a menagerie of colorful and deadly enemies. In this book of classic tales the Flash's speedy sidekick Kid Flash his pliable partner the Elongated Man and his inspiration and predecessor Jay Garrick-the original Flash-join the fastest man alive as he takes on the villainy of Captain Boomerang Mirror Master and the Trickster. Series design by Alex Jay / Studio J. Publication design by Louis Prandi. Black and white reconstruction on by Rob Leigh. Black and white reconstruction on some interior pages by Rick Keene.  Color reconstruction by Digital Chameleon.",
	  NULL,NULL,NULL,NULL,2002,NULL
