	  299810,NULL,18581,83,1967,
	  "0.12 USD",36.000,NULL,"Cover code: 10091-709. Code in lower right panel 1st page \"S.W. #2-676\" indicating this being issue #2 (presumably the 1963 printing was considered #1) and published June 1967 but indicia has no number and states \"Fourth Printing\" (presumably considering 1963 printing as the 3rd printing).",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  299811,"1",18582,83,1963,
	  "0.12 USD",36.000,NULL,"More than one printing exists; besides the 10/63 printing (printing #?) there is a stated \"Fifth Printing\" (in the indicia) dated \"687\" (i.e. July 1968) in lower left panel of 1st page with cover identical to 10/63 printing. If Four Color #92 and Four Color #545 are considered the 1st & 2nd printings the 10/63 may be the 3rd printing which means there is a stated 4th printing (needs to be verified). The \"Sixth Printing\" is the 1971 Gold Key nn issue. The 7th (and final) printing (not labeled as such in the indicia) is the 1982 Whitman nn issue.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  299812,NULL,18583,32,1971,
	  "0.15 USD",36.000,NULL,"Cover code: 10089-109. Stated as \"Sixth Printing\" is the indicia. If Four Color #92 and Four Color #545 are considered the 1st & 2nd printings the 10/63 Gold Key issue may be the 3rd printing which means there is a stated 4th printing (needs to be verified); there is a stated \"Fifth Printing\" with identical cover to the 10/63 (3rd?) printing. The 7th (and final) printing (not labeled as such in the indicia) is the 1982 Whitman nn issue.",
